import React, { Component } from "react";
import "../css/ToDoList.css";

class ToDoList extends Component<Props> {
  constructor() {
    super();
    this.state = {
      test_state: "test"
    };
  }
  render() {
    return (
      <div className="to-do-list-container">
        <input />
        <button>submit</button>
        <div>
          <text>item1</text>
          {this.state.test_state}
        </div>
      </div>
    );
  }
}

export default ToDoList;
